namespace Accord.DataSets
{
    using Accord.DataSets.Base;
    using Accord.Math;
    using System;

    /// <summary>
    ///   University of Wisconsin's (Prognostic) Breast Cancer data set.
    /// </summary>
    /// 
    /// <remarks>
    /// <para>
    ///   Each record represents follow-up data for one breast cancer case. These are consecutive 
    ///   patients seen by Dr. Wolberg since 1984, and include only those cases exhibiting invasive
    ///   breast cancer and no evidence of distant metastases at the time of diagnosis. </para>
    /// <para>
    ///   The first 30 features are computed from a digitized image of a fine needle aspirate (FNA) 
    ///   of a breast mass.They describe characteristics of the cell nuclei present in the image. A
    ///   few of the images can be found at http://www.cs.wisc.edu/~street/images/ </para>
    /// <para>
    ///   The separation described above was obtained using Multisurface Method-Tree(MSM-T) [K.P.Bennett, 
    ///   "Decision Tree Construction Via Linear Programming." Proceedings of the 4th Midwest Artificial 
    ///   Intelligence and Cognitive Science Society, pp. 97-101, 1992], a classification method which uses
    ///   linear programming to construct a decision tree. Relevant features were selected using an exhaustive
    ///   search in the space of 1-4 features and 1-3 separating planes.</para>
    /// <para>
    ///   The actual linear program used to obtain the separating plane in the 3-dimensional space is that 
    ///   described in: [K.P.Bennett and O.L.Mangasarian: "Robust Linear Programming Discrimination of Two 
    ///   Linearly Inseparable Sets", Optimization Methods and Software 1, 1992, 23-34]. </para>
    /// <para>
    ///   The Recurrence Surface Approximation (RSA) method is a linear programming model which predicts Time
    ///   To Recur using both recurrent and nonrecurrent cases.See references (i) and (ii) above for details 
    ///   of the RSA method.</para>
    ///   
    /// <para>
    ///   References:
    ///   <list type="bullet">
    ///     <item><description><a href="https://archive.ics.uci.edu/ml/datasets/Breast+Cancer+Wisconsin+(Prognostic)">
    ///       Lichman, M. "UCI Machine Learning Repository - Breast Cancer Wisconsin (Prognostic) Data Set."
    ///       Irvine, CA: University of California, School of Information and Computer Science, 2013</a>
    ///       </description></item>
    ///    </list></para>
    /// </remarks>
    /// 
    public class WisconsinPrognosticBreastCancer
    {
        /// <summary>
        ///   Gets the data instance features contained in Wisconsin's Breast Cancer dataset.
        /// </summary>
        /// 
        public double[][] Features { get; private set; }

        /// <summary>
        ///   Gets identifiers for each of the instances contained in Wisconsin's Breast Cancer dataset.
        /// </summary>
        /// 
        public int[] InstanceIds { get; private set; }

        /// <summary>
        ///   Gets the outcome for each of the data instances in the dataset. The outcomes can be either
        ///   0 (Recurring) or 1 (Non-recurring) depending on what happened at the time instants stored 
        ///   in <see cref="Time"/>.
        /// </summary>
        /// 
        public int[] Outcome { get; private set; }

        /// <summary>
        ///   Gets the time until a possible <see cref="Outcome"/> has been detected. If the outcome has been
        ///   ruled as recurring (0), it means that the cancer reocurred after the given number of days after 
        ///   the initial treatment performed for this patient. If the outcome is marker as non-recurring (1), 
        ///   it means the cancer has not been observed until the given number of days marked in this array.
        /// </summary>
        /// 
        public int[] Time { get; private set; }

        /// <summary>
        ///   Gets the class labels associated with each <see cref="Features">instance</see>
        ///   in Wisconsin's Breast Cancer dataset.
        /// </summary>
        /// 
        public int[] ClassLabels { get; private set; }

        /// <summary>
        ///   Gets the outcome labels in Wiscosin's Prognostic Breast Cancer dataset:
        ///   "Recurring" (cancer has re-orcurred during observation period), "Nonrecurring" (disease-free during observation period).
        /// </summary>
        /// 
        public string[] ClassNames { get; private set; }

        /// <summary>
        ///   Gets the variable names in Wisconsin's Breast Cancer dataset: 
        ///  "radius" (mean of distances from center to points on the perimeter),
        ///  "texture" (standard deviation of gray-scale values),
        ///  "perimeter",
        ///  "area",
        ///  "smoothness" (local variation in radius lengths),
        ///  "compactness" (perimeter^2 / area - 1.0),
        ///  "concavity" (severity of concave portions of the contour),
        ///  "concave points" (number of concave portions of the contour),
        ///  "symmetry",
        ///  "fractal dimension" ("coastline approximation" - 1)
        /// </summary>
        /// 
        public string[] VariableNames { get; private set; }

